import React, {Component,useState, useEffect} from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
// import axios from "axios";
import Reservation from './components/Reservation'
import ReservationList from './components/ReservaionList';
import Menubar from './components/menubar';
import ManagerMenubar from './components/managerMenubar';
import FinalPage from './components/finalPage';
import DateSelect from './components/dateSelect';
import SelectPage from './components/selectPage';
import ReserveListTotal from './components/reserveListTotal';
import Adminpagemenu from './components/adminPageMenu';
import WaitingList from './components/waitingList';
import ManageSys from './components/manageSys';
import api from "./api";
import axios from 'axios';



const table = {
  'name':'김미소',
  'pet':'달구',
  'address':'부산광역시',
  'telephone':'010-0000-0000',
  'gender': '여(중성화)',
  'species' : '믹스견(장모종)'
}

function App() {
  const [post, setPost] = useState([]);

  useEffect(() => {
    const token = 'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJjb3PthqDtgbAiLCJpZCI6MiwiZXhwIjoxNjkyNzg1ODEzLCJ1c2VybmFtZSI6Im5hdmVyX1BPbXlOMlNCSndaUmNXbXNUak05YWR6WnNrQ1Qta1Jxd0lick1STHI2LWsifQ.ndm6Q9GkjJZiwkXZae8VV5QDP7ydWp7YBN-ECVyQDWBe0OTwbecCkA11ebrqrrgEw-zqK1p0JHl16F1yz8Pu-g';
    axios({
      method: 'GET',
      url: '/userInfo',
      headers: {
        Authorization: `Bearer ${token}` // Bearer 토큰을 "Authorization" 헤더에 추가
      }
    })
      .then(response => {
        setPost('성공',response.data.result);
      })
      .catch(error => {
        console.error('에러 발생:', error);
      });
  }, []); 


  return (
    <div id = 'frame' >
        {/* <div>
        {data.map((result) => (
          <li key={result.username}>{result.name}</li>
        ))}
        </div> */}

        <Menubar/>
        {/* <Reservation/> */}
        {/* <FinalPage/>
        <SelectPage/>
        <ReserveListTotal/> */}


        <ManageSys/>


    </div>
  );
 }

export default App;

